import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './StudentDashboard.css';

function StudentDashboard() {
    const [name, setName] = useState('');
    const [studentId, setStudentId] = useState('');
    const navigate = useNavigate();

    const handleSearch = (event) => {
        event.preventDefault();
        const fetchedData = `查询结果: ${name} (学号: ${studentId}) 的宿舍信息...`;
        // 使用 navigate 进行页面跳转，传递查询结果
        navigate('/results', { state: { result: fetchedData } });
    };

    return (
        <div className="container mt-5">
            <h1>宿舍查询</h1>
            <form onSubmit={handleSearch}>
                <div className="mb-3">
                    <label htmlFor="name" className="form-label">姓名:</label>
                    <input
                        type="text"
                        className="form-control"
                        id="name"
                        value={name}
                        onChange={(e) => setName(e.target.value)}
                    />
                </div>
                <div className="mb-3">
                    <label htmlFor="studentId" className="form-label">学号:</label>
                    <input
                        type="text"
                        className="form-control"
                        id="studentId"
                        value={studentId}
                        onChange={(e) => setStudentId(e.target.value)}
                    />
                </div>
                <button type="submit" className="btn btn-primary">开始查询</button>
            </form>
        </div>
    );
}

export default StudentDashboard;
